import { useParams } from "react-router-dom"


export default function AlbumPlaceHolder() {
    const params = useParams();

    return (
        <div className="albumPlaceHolder" >
            <h1>Album Page</h1>
            <p>The album name is: {params.name}</p>
        </div>
    )
}
